INSERT INTO `faqs` (`id`, `title`, `details`, `language_id`) VALUES
(1, 'FAQ', '<h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">1. Improves user experience</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">One of the top advantages of having FAQs on your eCommerce store is to improve the user experience.&nbsp;</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">FAQs consists of questions that your customers frequently have. Hence, addressing them and answering them keeps them informed about your products. When they feel their queries are being listened to and answered, users, are more likely to trust your products as well as your brand.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">And, customer experience has become the topmost factor for the success of any eCommerce business. So, having it, ensures you’re making your customers happy and satisfied.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">2. Increases conversions</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Another key reason to have eCommerce FAQs is to increase conversions. Most online buyers have some or the other queries related to your product, its size, the delivery options, and more.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">If such queries are addressed appropriately at the right moment, it can help the potential buyers to make the buying decision faster. That’s how FAQs invoke the speed for conversions.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">3. Saves time and money on customer services</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Earlier, customers used to email or call the customer support executives to find their answers. Such efforts can be saved with the help of eCommerce FAQs.&nbsp;</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">On top of that, you serve better with FAQs compared to the emails and phone calls. Your customers feel you’ve saved their time in figuring out whether this is the right product for them or not.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\">So, a good job here!</h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Not all queries can be resolved using FAQs, but the general ones can be. Make sure you include all the general queries in your FAQs.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">4. Boosts SEO results</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Undoubtedly, frequently asked questions (FAQs) have a massive impact on SEO. When you include FAQs exactly the way they’re asked on the search engines, it can help you boost your product keyword rankings.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Also, today, there is a huge demand for voice shopping, and voice search is considered as one of the trending things in the entire digital world.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Check out a few voice commerce (shopping) statistics–</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px; color: rgb(41, 41, 41); font-family: assistant, arial;\">By 2022, voice shopping is expected to reach USD 40 billion.&nbsp;</span><br></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">More than 30% of US internet users use a voice-based assistant to look a product information or purchase products.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Use all the queries that people might search using voice assistants or voice search in your FAQ page or section. It will help you boost your product pages on top of the search engines.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">The more organic traffic you will have, the more you’ll have conversions. So, FAQ also results in outperforming the competition in all ways.</span></font></h3>', 1),
(2, 'FAQ', '<h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">1. Improves user experience</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">One of the top advantages of having FAQs on your eCommerce store is to improve the user experience.&nbsp;</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">FAQs consist of questions that your customers frequently have. Hence, addressing them and answering them keeps them informed about your products. When they feel their queries are being listened to and answered, users, are more likely to trust your products as well as your brand.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">And, customer experience has become the topmost factor for the success of any eCommerce business. So, having it, ensures you’re making your customers happy and satisfied.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">2. Increases conversions</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Another key reason to have eCommerce FAQs is to increase conversions. Most online buyers have some or other queries related to your product, its size, delivery options, and more.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">If such queries are addressed appropriately at the right moment, it can help potential buyers to make the buying decision faster. That’s how FAQs invoke the speed for conversions.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">3. Saves time and money on customer services</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Earlier, customers used to email or call customer support executives to find their answers. Such efforts can be saved with the help of eCommerce FAQs.&nbsp;</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">On top of that, you serve better with FAQs compared to emails and phone calls. Your customers feel you’ve saved their time in figuring out whether this is the right product for them or not.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\">So, a good job here!</h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Not all queries can be resolved using FAQs, but general ones can be. Make sure you include all the general queries in your FAQs.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">4. Boosts SEO results</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Undoubtedly, frequently asked questions (FAQs) have a massive impact on SEO. When you include FAQs exactly the way they’re asked on the search engines, it can help you boost your product keyword rankings.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Also, today, there is a huge demand for voice shopping, and voice search is considered as one of the trending things in the entire digital world.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Check out a few voice commerce (shopping) statistics–</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px; color: rgb(41, 41, 41); font-family: assistant, arial;\">By 2022, voice shopping is expected to reach USD 40 billion.&nbsp;</span><br></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">More than 30% of US internet users use a voice-based assistant to look a product information or purchase products.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">Use all the queries that people might search using voice assistants or voice search in your FAQ page or section. It will help you boost your product pages on top of the search engines.</span></font></h3><h3 style=\"overflow-wrap: break-word; margin-right: auto; margin-bottom: 18px; margin-left: auto; line-height: 1.2; max-width: 100%; padding-top: 20px;\"><font color=\"#292929\" face=\"assistant, arial\"><span style=\"font-size: 21.6px; letter-spacing: -0.3px;\">The more organic traffic you will have, the more you’ll have conversions. So, FAQ also results in outperforming the competition in all ways.</span></font></h3>', 1),
